import React from 'react';
import Inbox from '../Components/Inbox/Inbox';


const InboxPage = () => {
    return (
        <div className='mt-3'>
            <div className='shadow rounded-3'>
                <div className='p-3'>
                    <Inbox />
                </div>
            </div>
        </div>
    );
};

export default InboxPage;
